import React from "react";
import { BrowserRouter } from 'react-router-dom';
import { MDBNav, MDBNavItem, MDBNavLink } from "mdbreact";

const gridExamplesPage = () => {
    return (
    <MDBContainer>
      <MDBRow>
        <MDBCol md="4">.col-md-4</MDBCol>
        <MDBCol md="4">.col-md-4</MDBCol>
        <MDBCol md="4">.col-md-4</MDBCol>
      </MDBRow>
    </MDBContainer>
    );
    }

    export default gridExamplesPage;
